var tipuesearch = {"pages": [{'title': 'About', 'text': 'w11 \n 1a-ag1 \n https://s5.eng.nfu.edu.tw:9499/ \xa0 \n \n \n 影片介紹: https://youtu.be/usFmvSHkH84 \n \n 可攜程式套件: \n portable_2026.7z \xa0(387MB) \n 解開壓縮後，雙點擊\xa0start_miniconda3.bat 啟動可攜系統，雙點擊 stop.bat 關閉可攜系統。 \n 可攜系統啟動後，在命令列執行 conda activate y:\\envs\\cmsimde 可進入能執行 CMSiMDE 的環境。 \n 若希望可攜系統啟動直接進入 cmsimde 環境，可將 start_miniconda3.bat 檔案中第 98 行: call "%CONDA_ROOT%\\Scripts\\activate.bat" %ENV_NAME% 更換為 call "%CONDA_ROOT%\\Scripts\\activate.bat" %Disk%:\\envs\\cmsimde \n', 'tags': '', 'url': 'About.html'}, {'title': 'Reeborg', 'text': 'https://mde.tw/cp2025/reeborg?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest1.json&editor=python/harvest1.py \n https://mde.tw/cp2025/reeborg?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest1.json&editor=python/harvest1_east_west.py \xa0 \n \n https://mde.tw/reeborg \n https://github.com/mdecycu/cs101 \n https://reeborg.ca/docs/en/python/index.html \n https://aroberge.github.io/reeborg-api/ \n if using local static port 9442: \n Reeborg \n For Github Pages: \n Reeborg \n ======= \n', 'tags': '', 'url': 'Reeborg.html'}, {'title': '關於', 'text': 'w11 \n 1a-ag1 \n https://s5.eng.nfu.edu.tw:9499/ \xa0 \n \n 遠端網站 7x7Lab(測試版) \n https://mdecp2025.github.io/1a-ag1/ \n <<<<<<< HEAD >>>>>>> c6fc41a (123) ======= \n 1+1=2 \n >>>>>>> 4d4b598 (1=1) \n \n 可攜程序套件： \n portable_2026.7z  \xa0(387MB) \n 解開壓縮後，雙點選start_miniconda3.bat啟動可攜系統，雙點選stop.bat關閉可攜系統。 \n 可攜系統啟動後，在指令列執行 conda activate y:\\envs\\cmsimde 可進入能執行 CMSiMDE 的環境。 \n 若希望可攜帶系統啟動直接進入 cmsimde 環境，可將 start_miniconda3.bat 檔案中第 98 行: call "%CONDA_ROOT%\\Scripts\\activate.bat" %ENV_NAME% 更換為 call "%CONDA_ROOT%\\Scripts\\activate.bat" activate.bat" %D%cmded. \n', 'tags': '', 'url': '關於.html'}, {'title': '銳博', 'text': 'https://mde.tw/cp2025/reeborg?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest1.json&editor=python/harvest1.py \n https://mde.tw/cp2025/reeborg?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest1.json&editor=python/harvest1_east_west.py1_east_west.py \xa0 \n \n https://mde.tw/reeborg \n https://github.com/mdecycu/cs101 \n https://reeborg.ca/docs/en/python/index.html \n https://aroberge.github.io/reeborg-api/ \n 如果使用本機靜態連接埠 9442： \n 銳博 \n 對於 GitHub Pages： \n 銳博 \n \n', 'tags': '', 'url': '銳博.html'}, {'title': '例1', 'text': 'https://mde.tw/cp2025/reeborg?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=wor lds/tutorial_en/harvest1.json&editor=python/harvest1.py \xa0是已知的機器人採收紅蘿蔔的方案，難民以下與副駕駛的對話，希望透過Python類的編寫解決方案特定範圍進行採收的方案。 \n 答案: \n 以下是 Reeborg 一個用來採收紅蘿蔔的方案，目前位於 (3,3) 到 (8,8) 的區域中各座標點，各有一個紅羅蔔等待採收，現在想要建立一個 Harves() 類，可以利用 (3,3), (8,8) 作為標定有燈光必須採標的兩個項目對角採標的兩個項目來收 \n    for i in range(int): \n        左轉（） \n         \ndef new_move(int): \n    for i in range(int): \n        移動（） \n         \ndef harvest_one_row(): \n    while object_here(): \n        拿（） \n    別的： \n        移動（） \n# 移至場地 \nnew_move(2) \n左轉（） \nnew_move(2) \n \nfor i in range(3): \n    while is_facing_north(): \n        for i in range(6): \n            收穫單行() \n        for i in range(2): \n            回合(3) \n            移動（） \n    別的： \n        for i in range(6): \n            收穫單行() \n        for i in range(2): \n            左轉（） \n            移動（） \n AI 答：\xa0  https://mde.tw/cp2025/reeborg?lang =en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest1.json&editor=python/harvest1_class_ex1ial_en/harvest1.json&editor=python/harvest1_class_ex1.pypy \xa0 \n 進一步要求： \n 請在類別中加上一個採收方向的參數，內建變數是水平採收，圓由西邊往東邊的水平方向進行採收，但若該方向變數設為垂直由南邊往北的稱垂直方向進行採收 \n AI 回應：\xa0  https://mde.tw/cp2025/reeborg?lang\xa0 =en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest1.json&editor=python/harvest1_class_ex2.py \xa0 \n 延伸至採收 Harvest2 農地：\xa0  https://mde.tw/cp2025/reeborg/?lang =en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvestitor2.json&edpyitor2.json&edpython/py1. \xa0 \n 但卻沒能套用到 harvest3 農田:\xa0 https://mde.tw/cp2025/reeborg/?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest3.json&editor=python/harvest1_class_ex1.py \xa0 \n 而必須要在每一個座標點留下或放入一個紅蘿蔔:\xa0 https://mde.tw/cp2025/reeborg/?lang=en&mode=python&menu=worlds/menus/select_collection_en.json&name=Alone&url=worlds/tutorial_en/harvest3.json&editor=python/harvest1_class_ex3.py\xa0 \xa0 \n', 'tags': '', 'url': '例1.html'}, {'title': 'Otto_ninja', 'text': 'https://www.printables.com/model/231580-otto-ninja-starter-robot/files \xa0 \n \n', 'tags': '', 'url': 'Otto_ninja.html'}, {'title': 'Brython', 'text': '1 add to 100 機器人巡邏 自由行 \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  累加程式開始  \n \n  累加程式結束     機器人巡邏程式開始  \n \n  機器人巡邏程式結束  \n  機器人自由行程式開始  \n \n \n \n  機器人自由行程式結束  \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n', 'tags': '', 'url': 'Brython.html'}, {'title': 'Brython_ex', 'text': '機器人自由行 \n Can we bring pythonpad into this page?\xa0 https://pythonpad.github.io/docs/manual.html \xa0 \n from browser import document, html, timer \n  \ncanvas = html.CANVAS(width=400, height=400) \nbrython_div = document["brython_div1"] \nbrython_div <= canvas \nctx = canvas.getContext("2d") \n  \ndef draw_grid(): \n    ctx.clearRect(0, 0, 400, 400) \n    ctx.strokeStyle = "#ccc" \n    ctx.lineWidth = 1 \n    for i in range(0, 401, 40): \n        ctx.beginPath() \n        ctx.moveTo(i, 0) \n        ctx.lineTo(i, 400) \n        ctx.stroke() \n        ctx.beginPath() \n        ctx.moveTo(0, i) \n        ctx.lineTo(400, i) \n        ctx.stroke() \n     \n    # 畫出邊界 \n    ctx.strokeStyle = "black" \n    ctx.lineWidth = 2 \n    ctx.strokeRect(0, 0, 400, 400) \n \ndef draw_robot(x, y): \n    draw_grid() \n    ctx.fillStyle = "blue" \n    ctx.beginPath() \n    ctx.arc(x * 40 + 20, y * 40 + 20, 15, 0, 6.28) \n    ctx.fill() \n \nx, y = 0, 0 \ndef move(): \n    global x \n    x = (x + 1) % 10 \n    draw_robot(x, y) \n \ndraw_grid() \ntimer.set_interval(move, 500) \n 以下程式, 按 j 隨箭頭方向前進, 按下 i 則左轉 \n from browser import document, html, bind \n \ncanvas = html.CANVAS(width=400, height=400) \nbrython_div = document["brython_div1"] \nbrython_div <= canvas \nctx = canvas.getContext("2d") \n \ncols, rows = 10, 10 \ncell = 40 \n \n# 上、右、下、左 \ndirections = [(0, -1), (1, 0), (0, 1), (-1, 0)] \n \nrobot = { \n    "x": 5, \n    "y": 5, \n    "dir": 0  # 初始朝向上 \n} \n \ndef draw_grid(): \n    ctx.clearRect(0, 0, 400, 400) \n    ctx.strokeStyle = "#ccc" \n    ctx.lineWidth = 1 \n    for i in range(0, 401, cell): \n        ctx.beginPath() \n        ctx.moveTo(i, 0) \n        ctx.lineTo(i, 400) \n        ctx.stroke() \n        ctx.beginPath() \n        ctx.moveTo(0, i) \n        ctx.lineTo(400, i) \n        ctx.stroke() \n    ctx.strokeStyle = "black" \n    ctx.lineWidth = 2 \n    ctx.strokeRect(0, 0, 400, 400) \n \ndef draw_robot(): \n    draw_grid() \n    cx = robot["x"] * cell + cell // 2 \n    cy = robot["y"] * cell + cell // 2 \n    size = 15 \n    d = robot["dir"] \n \n    ctx.fillStyle = "blue" \n    ctx.beginPath() \n    if d == 0:  # 上 \n        ctx.moveTo(cx, cy - size) \n        ctx.lineTo(cx - size, cy + size) \n        ctx.lineTo(cx + size, cy + size) \n    elif d == 1:  # 右 \n        ctx.moveTo(cx + size, cy) \n        ctx.lineTo(cx - size, cy - size) \n        ctx.lineTo(cx - size, cy + size) \n    elif d == 2:  # 下 \n        ctx.moveTo(cx, cy + size) \n        ctx.lineTo(cx - size, cy - size) \n        ctx.lineTo(cx + size, cy - size) \n    elif d == 3:  # 左 \n        ctx.moveTo(cx - size, cy) \n        ctx.lineTo(cx + size, cy - size) \n        ctx.lineTo(cx + size, cy + size) \n    ctx.closePath() \n    ctx.fill() \n \n@bind(document, "keydown") \ndef on_key(e): \n    key = e.key.lower() \n    if key == "i": \n        robot["dir"] = (robot["dir"] - 1) % 4  # 左轉 \n    elif key == "j": \n        dx, dy = directions[robot["dir"]] \n        nx = robot["x"] + dx \n        ny = robot["y"] + dy \n        if 0 <= nx < cols and 0 <= ny < rows: \n            robot["x"] = nx \n            robot["y"] = ny \n    繪製機器人() \n \n繪製機器人() \n 最佳化: \n 題目： 一位製造想設計一個開口式的盒子，其底部為長方形，寬為x、長為y，且總長度為80平方商分。請問要讓盒子的體積達到最大，又該採用哪些尺寸？ \n 直接利用Python以 Differential Evoluation 侵犯：\xa0  de_volume_max.py \n 參考：\xa0 \n de_volume_max.c 、\xa0  de_volume_max.v \n 也可以採用網頁前端使用 Brython，支架採用 Python 執行攻擊後將資料傳回網頁：\xa0  brython_w_flask.7z \n', 'tags': '', 'url': 'Brython_ex.html'}, {'title': '派奧迪德', 'text': '\n \n \n 版本   你好   1 加到 100   機器人巡邏 自由行   numpy_ode \n  Ace Editor Scripts  \n \n \n \n \n \n \n \n \n  Editor 1  \n \n 跑步   輸出   明確輸出區   重新載入 \n \n \n \n \n \n 從1累加到100第2部分： \n 1 加到 100 \n  Editor 2  \n \n 跑步   輸出   明確輸出區   重新載入 \n \n \n \n \n \n \n \n', 'tags': '', 'url': '派奧迪德.html'}, {'title': 'Pyodide_ex', 'text': 'Pyodide機器人巡邏 \n Pyodide導入客製化模組： \n const code = ` \n# 定義一個模組內容 \ndef hello(): \n    print("來自自訂模組的問候！") \n`; \npyodide.runPython(code); \n \n Volume_max_pyodide_de_short.py \n Volume_max_pyodide_de.py \n', 'tags': '', 'url': 'Pyodide_ex.html'}]};